import React from 'react'
import './SearchBar.css';

const SearchBar = () => {
    return (
        <form className="searchBar">
            <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />

        </form>
    )
}

export default SearchBar
